import React from "react";
import EditSearch from "../EditSearch";
import "./Frame3619.css";

function Frame3619(props) {
  const { editSearchProps, className } = props;

  return (
    <div className={`frame-3619 border-0-5px-quarter-spanish-white ${className || ""}`}>
      <EditSearch editSearch={editSearchProps.editSearch} />
    </div>
  );
}

export default Frame3619;
